import styles from './ReportForm.module.css'
import { PlusOutlined } from '@ant-design/icons';
import { FormControl, FormLabel, RadioGroup, FormControlLabel } from '@material-ui/core';
import { Radio } from 'antd';

import React, { useState } from 'react';



function ReportForm({ open, onCancel }: { open: boolean, onCancel: any }) {
    return (
        <div onClick={onCancel} className={styles.box} style={{ display: open ? 'block' : 'none' }}>
            <div onClick={(e) => { e.stopPropagation() }} className={styles.contentBox}>
                <FormDisabledDemo />
            </div>
        </div>
    )
}

export default ReportForm;




const normFile = (e: any) => {
    if (Array.isArray(e)) {
        return e;
    }
    return e?.fileList;
};

const FormDisabledDemo: React.FC = () => {
    const [actionType, setActionType] = useState("1");

    return (
        <>
            <div className={styles.title1}>GSK 不良事件报告表</div>
            <div className={styles.title2}>机构/项目信息</div>
            <FormControl component="fieldset">
      <FormLabel component="legend" style={{color:'#666'}}>*活动类型</FormLabel>
      <RadioGroup row aria-label="gender" name="gender1" value={actionType} onChange={(e)=>{setActionType(e.target.value)}}>
        <FormControlLabel value="1" control={<Radio />} label="市场研究" />
        <FormControlLabel value="2" control={<Radio />} label="患者支持项目" />
        <FormControlLabel value="3" control={<Radio />} label="数字媒体" />
      </RadioGroup>
    </FormControl>
        </>
    );
};
